import Model from 'react-modal'
import {useState} from 'react'

export default function Login() {
    const [visible, setVisible] =useState(false)
    return(
        <div>
            <button onClick={()=>setVisible(true)}>Login</button>
            <Model isOpen={visible}>
                <h1>Model Body</h1>
            </Model>
        </div>
    )
}
